import logo from './logo.svg';
import './App.scss';

function App(props) {
  return (
    <div className="App">
      <header className="wrapper">
        <h1 className="glitch" data-text={props.name}>
          {props.name}
        </h1>
        <span className="sub">
          {props.role}
        </span>
      </header>
    </div>
  );
}

export default App;
